3-х комнатная квартира
Продам уютную квартиру (3 комнаты) на 1 этаже (5-ти этажный кирпичный тёплый дом, ухоженный) 1987 год постройки (ул. Островского 147). Во дворе большая парковка, современная детская площадка с мягким покрытием. В шаговой доступности вокзал. Квартира вложений не требует. Окна пластиковые, потолки натяжные, дверь входная новая. Сан узел раздельно (сантехнмку меняли, новая). Соседи тихие, семейные, подъезд чистый (был ремонт). Идеальный вариант для семьи, заходи и живи. Собственник. Продаём в связи с переездом. Квартира без долгов и обремененний. Подходит под ипотеку любого банка.
В квартире остаётся:
\- кухонный гарнитур, стол, стулья (на кухне);
\- газовая плита, стиральная машина;
\- прихожая, шкаф купе (в коридоре);
\- диван, стенка, шкаф купе (в спальне);
\- шкаф, комод, стол (в спальне).
Реальному покупателю будет торг.

